(1, '2018-05-10 18:52:28', 'Allows the app to view and modify all downloads initiated by any app on the system.', 'ACCESS_ALL_DOWNLOADS', 'android.permission.ACCESS_ALL_DOWNLOADS', 3),
(2, '2018-05-10 18:52:28', 'Allows the holder to access print jobs created by another app. Should never be needed for normal apps.', 'ACCESS_ALL_PRINT_JOBS', 'com.android.printspooler.permission.ACCESS_ALL_PRINT_JOBS', 3),
(3, '2018-05-10 18:52:28', 'Allows the app to access the BluetoothShare manager and use it to transfer files.', 'ACCESS_BLUETOOTH_SHARE', 'android.permission.ACCESS_BLUETOOTH_SHARE', 3),
(4, '2018-05-10 18:52:28', 'Allows the app to read and write the cache filesystem.', 'ACCESS_CACHE_FILESYSTEM', 'android.permission.ACCESS_CACHE_FILESYSTEM', 4),
(5, '2018-05-10 18:52:28', 'Allows read/write access to the \"properties\" table in the checkin database, to change values that get uploaded. Not for use by third-party applications.', 'ACCESS_CHECKIN_PROPERTIES', 'android.permission.ACCESS_CHECKIN_PROPERTIES', 4),
(6, '2018-05-10 18:52:28', 'Allows an app to access approximate location. Alternatively, you might want ACCESS_FINE_LOCATION.', 'ACCESS_COARSE_LOCATION', 'android.permission.ACCESS_COARSE_LOCATION', 2),
